import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const storeLocations = [
  { id: 1, name: 'Store A', zipCode: '12345' },
  { id: 2, name: 'Store B', zipCode: '23456' },
  // Add more store locations here
  { id: 3, name: 'Store C', zipCode: '34567' },
  { id: 4, name: 'Store D', zipCode: '45678' },
  { id: 5, name: 'Store E', zipCode: '56789' },
  { id: 6, name: 'Store F', zipCode: '67890' },
  { id: 7, name: 'Store G', zipCode: '78901' },
  { id: 8, name: 'Store H', zipCode: '89012' },
  { id: 9, name: 'Store I', zipCode: '90123' },
  { id: 10, name: 'Store J', zipCode: '01234' }
];

function CheckoutPage() {
  const [deliveryType, setDeliveryType] = useState('homeDelivery');
  const [storeId, setStoreId] = useState(null);
  const [customerData, setCustomerData] = useState({
    name: '',
    address: '',
    city: '',
    state: '',
    zipCode: ''
  });
  const navigate = useNavigate();

  const handleCheckout = () => {
    const orderDetails = {
      cart: [], // Replace with actual cart data
      confirmationNumber: '1234567890',
      orderDate: new Date().toISOString(),
      deliveryDate: new Date(new Date().setDate(new Date().getDate() + 12)).toISOString(), // 12 days from today
      totalCost: 100.00, // Replace with actual total cost
      deliveryType,
      storeId,
      customerData
    };

    // Save order details to localStorage or API
    const orders = JSON.parse(localStorage.getItem('orders')) || [];
    orders.push(orderDetails);
    localStorage.setItem('orders', JSON.stringify(orders));

    // Navigate to OrdersPage with order details
    navigate('/orders', { state: { orderDetails } });
  };

  return (
    <div>
      <h2>Checkout</h2>
      <form onSubmit={(e) => { e.preventDefault(); handleCheckout(); }}>
        <label>
          <input
            type="radio"
            value="homeDelivery"
            checked={deliveryType === 'homeDelivery'}
            onChange={() => setDeliveryType('homeDelivery')}
          />
          Home Delivery
        </label>
        <label>
          <input
            type="radio"
            value="storePickup"
            checked={deliveryType === 'storePickup'}
            onChange={() => setDeliveryType('storePickup')}
          />
          Store Pickup
        </label>

        {deliveryType === 'storePickup' && (
          <div>
            <label>
              Select Store:
              <select onChange={(e) => setStoreId(parseInt(e.target.value))}>
                <option value="">--Select a Store--</option>
                {storeLocations.map(store => (
                  <option key={store.id} value={store.id}>{store.name}</option>
                ))}
              </select>
            </label>
          </div>
        )}

        {deliveryType === 'homeDelivery' && (
          <div>
            <label>
              Name:
              <input
                type="text"
                value={customerData.name}
                onChange={(e) => setCustomerData({ ...customerData, name: e.target.value })}
                required
              />
            </label>
            <label>
              Address:
              <input
                type="text"
                value={customerData.address}
                onChange={(e) => setCustomerData({ ...customerData, address: e.target.value })}
                required
              />
            </label>
            <label>
              City:
              <input
                type="text"
                value={customerData.city}
                onChange={(e) => setCustomerData({ ...customerData, city: e.target.value })}
                required
              />
            </label>
            <label>
              State:
              <input
                type="text"
                value={customerData.state}
                onChange={(e) => setCustomerData({ ...customerData, state: e.target.value })}
                required
              />
            </label>
            <label>
              Zip Code:
              <input
                type="text"
                value={customerData.zipCode}
                onChange={(e) => setCustomerData({ ...customerData, zipCode: e.target.value })}
                required
              />
            </label>
          </div>
        )}

        <button type="submit">Place Order</button>
      </form>
    </div>
  );
}

export default CheckoutPage;
